import React from "react";
import Block from "./Block";

export default function DivBlock({ blocks }) {
  return (
    <div className="App">
      {blocks.map((block, index) =>
        blocks.map((v, index2) => <Block text={block[index][index2]} />)
      )}
    </div>
  );
}
